import * as React from "react";
import {
	Box,
	TextField,
	Typography,
	Button,
	MenuItem,
	Stack,
} from "@mui/material";
import { updateUser, getUser, getCurrentUser, changePassword } from "../../Utilities/firebase";
import { useNavigate } from "react-router-dom";

const drawerWidth = 240;

const universityOptions = [
	{ text: "Northwestern University" },
	{ text: "University of Chicago" },
	{ text: "University of Illinois Urbana-Champaign" },
	{ text: "Johns Hopkins University" },
	{ text: "Georgia Institute of Technology" },
	{ text: "Cornell University" },
	{ text: "University of California, Berkeley" },
	{ text: "University of California, Los Angeles" },
	{ text: "University of Southern California" }
]

const majorOptions = [
	{ text: "African American Studies" },
	{ text: "African Studies" },
	{ text: "American Studies" },
	{ text: "Anthropology" },
	{ text: "Applied Mathematics" },
	{ text: "Art History" },
	{ text: "Art Theory and Practice" },
	{ text: "Asian American Studies" },
	{ text: "Asian Languages and Cultures" },
	{ text: "Biological Sciences" },
	{ text: "Biomedical Engineering" },
	{ text: "Chemical Engineering" },
	{ text: "Chemistry" },
	{ text: "Civil Engineering" },
	{ text: "Classics" },
	{ text: "Cognitive Science" },
	{ text: "Communication Studies" },
	{ text: "Comparative Literary Studies" },
	{ text: "Composition" },
	{ text: "Computer Engineering" },
	{ text: "Computer Science" },
	{ text: "Creative Writing" },
	{ text: "Dance" },
	{ text: "Data Science" },
	{ text: "Earth and Planetary Sciences" },
	{ text: "Economics" },
	{ text: "Electrical Engineering" },
	{ text: "Elementary Teaching" },
	{ text: "English and American Literature" },
	{ text: "Environmental Engineering" },
	{ text: "Environmental Sciences" },
	{ text: "French" },
	{ text: "Gender and Sexuality Studies" },
	{ text: "Geography" },
	{ text: "German" },
	{ text: "Global Health Studies" },
	{ text: "History" },
	{ text: "Human Communication Sciences" },
	{ text: "Human Development in Context" },
	{ text: "Industrial Engineering" },
	{ text: "Integrated Science" },
	{ text: "International Studies" },
	{ text: "Italian Literature and Culture" },
	{ text: "Jazz Studies" },
	{ text: "Jewish Studies" },
	{ text: "Journalism" },
	{ text: "Latina and Latino Studies" },
	{ text: "Learning and Organizational Change" },
	{ text: "Learning Sciences" },
	{ text: "Legal Studies" },
	{ text: "Linguistics" },
	{ text: "Manufacturing and Design Engineering" },
	{ text: "Materials Science" },
	{ text: "Mathematics" },
	{ text: "Mechanical Engineering" },
	{ text: "Middle East and North African Studies" },
	{ text: "MMSS" },
	{ text: "Music Cognition" },
	{ text: "Music Education" },
	{ text: "Music Theory" },
	{ text: "Musicology" },
	{ text: "Neuroscience" },
	{ text: "Performance Studies" },
	{ text: "Philosophy" },
	{ text: "Physics" },
	{ text: "Piano" },
	{ text: "Political Science" },
	{ text: "Psychology" },
	{ text: "Radio/Television/Film" },
	{ text: "Religious Studies" },
	{ text: "Science in Human Culture" },
	{ text: "Slavic Languages and Literatures" },
	{ text: "Social Policy" },
	{ text: "Sociology" },
	{ text: "Spanish" },
	{ text: "Statistics" },
	{ text: "String Instruments" },
	{ text: "Theatre" },
	{ text: "Voice and Opera" },
	{ text: "Winds and Percussion Instruments" },
]

const raceOptions = [
	{ text: "American Indian or Alaska Native" },
	{ text: "Asian" },
	{ text: "Black or African American" },
	{ text: "Hispanic or Latino" },
	{ text: "Native Hawaiian or Other Pacific Islander" },
	{ text: "White" },
];

const genderOptions = [
	{ text: "Female" },
	{ text: "Male" },
	{ text: "Non-binary" },
	{ text: "Transgender" },
	{ text: "Intersex" },
	{ text: "Prefer Not to Say" },
];

const months = [
	{ value: 1, label: "January" },
	{ value: 2, label: "February" },
	{ value: 3, label: "March" },
	{ value: 4, label: "April" },
	{ value: 5, label: "May" },
	{ value: 6, label: "June" },
	{ value: 7, label: "July" },
	{ value: 8, label: "August" },
	{ value: 9, label: "September" },
	{ value: 10, label: "October" },
	{ value: 11, label: "November" },
	{ value: 12, label: "December" },
];

const years = [
	{ value: 2022, label: "2022" },
	{ value: 2023, label: "2023" },
	{ value: 2024, label: "2024" },
	{ value: 2025, label: "2025" },
	{ value: 2026, label: "2026" },
	{ value: 2027, label: "2027" },
];

class Profile extends React.Component {
	constructor(props) {
		super(props);
		this.handleSubmit = this.handleSubmit.bind(this);
		// this.handleMonthChange = this.handleMonthChange.bind(this);
		// this.handleYearChange = this.handleYearChange.bind(this);
		this.state = {
			user: null,
			// month: 1,
			// year: 2022,
		};
	}

	async componentDidMount() {
		await getCurrentUser().then(async (user) => {
			if (user == null) {
				this.props.navigate("/signin");
			} else {
				var userData = await getUser(user.uid);

				this.setState({
					user: userData,
				});
				// getUser(user.uid).then((userdata) => {
				//     this.setState({
				//         user: userdata,
				//     });
				// if (this.state.user) {
				//     const initial_month = this.state.user;
				//     const initial_year = this.state.user;
				//     this.setState({
				//         month: initial_month,
				//         year: initial_year,
				//     });
				// }
				// });
			}
		});
	}

	handleSubmit = async (event) => {
		event.preventDefault();
		const data = new FormData(event.currentTarget);

		const updatedUser = {
			...this.state.user,
			first_name: data.get("first_name"),
			last_name: data.get("last_name"),
			grad_month: data.get("grad_month"),
			grad_year: data.get("grad_year"),
			university: data.get("university"),
			major: data.get("major"),
			race: data.get("race"),
			gender: data.get("gender"),
		};
		await updateUser(this.state.user.user_id, updatedUser);
		alert("Your changes have been saved.");
	};

	async handleChangePassword(email) {
		await changePassword(email);
	}

	/*
	handleMonthChange = (event) => {
		event.preventDefault();
		this.setState({
			month: event.target.value,
		});
	};

	handleYearChange = (event) => {
		event.preventDefault();
		this.setState({
			year: event.target.value,
		});
	};
	*/

	render() {
		if (this.state.user) {
			return (
				<Box
					sx={{
						flexGrow: 1,
						p: 1,
						width: { sm: `calc(100% - ${drawerWidth}px)` },
						"& .MuiTextField-root": { m: 1, width: "25ch" },
					}}
					onSubmit={this.handleSubmit}
					noValidate
					autoComplete='off'
					component='form'>
					<Typography variant='h3' mb={2}>
						Profile
					</Typography>
					<Typography variant='body1' mb={1}>
						Please fill out all required entries to view job opportunities.
					</Typography>
					<Box>
						<TextField
							required
							id='first_name'
							name='first_name'
							label='First Name'
							defaultValue={this.state.user.first_name}
						/>
						<TextField
							required
							id='last_name'
							name='last_name'
							label='Last Name'
							defaultValue={this.state.user.last_name}
						/>
					</Box>
					<Box>
						<TextField
							required
							select
							id='grad_month'
							name='grad_month'
							label='Graduation Month'
							defaultValue={
								this.state.user.grad_month === -1
									? null
									: this.state.user.grad_month
							}
						>
							{months.map((option) => (
								<MenuItem key={option.value} value={option.value}>
									{option.label}
								</MenuItem>
							))}
						</TextField>
						<TextField
							required
							select
							id='grad_year'
							name='grad_year'
							label='Graduation Year'
							defaultValue={
								this.state.user.grad_year === -1
									? null
									: this.state.user.grad_year
							}
						>
							{years.map((option) => (
								<MenuItem key={option.value} value={option.value}>
									{option.label}
								</MenuItem>
							))}
						</TextField>
					</Box>
					<Box>
						<TextField
							id='university'
							name='university'
							label='University'
							defaultValue={
								this.state.user.university === "" ? null : this.state.user.university
							}
							disabled
						/>
						<TextField
							select
							id='major'
							name='major'
							label='Major'
							defaultValue={
								this.state.user.major === "" ? null : this.state.user.major
							}
							sx={{
								minWidth: 400,
							}}>
							{majorOptions.map((option) => (
								<MenuItem
									key={option.text}
									value={option.text}
									sx={{
										minWidth: 400,
									}}>
									{option.text}
								</MenuItem>
							))}
						</TextField>
					</Box>
					<Stack>
						<TextField
							select
							id='race'
							name='race'
							label='Race'
							defaultValue={
								this.state.user.race === "" ? null : this.state.user.race
							}
							sx={{
								minWidth: 400,
							}}>
							{raceOptions.map((option) => (
								<MenuItem
									key={option.text}
									value={option.text}
									sx={{
										minWidth: 400,
									}}>
									{option.text}
								</MenuItem>
							))}
						</TextField>
						<TextField
							select
							id='gender'
							name='gender'
							label='Gender'
							defaultValue={
								this.state.user.gender === "" ? null : this.state.user.gender
							}
							sx={{
								minWidth: 400,
							}}>
							{genderOptions.map((option) => (
								<MenuItem
									key={option.text}
									value={option.text}
									sx={{
										minWidth: 400,
									}}>
									{option.text}
								</MenuItem>
							))}
						</TextField>
					</Stack>
					<Stack direction="row">
						<Button
							type='submit'
							variant='contained'
							sx={{ m: 1, backgroundColor: "primary" }}>
							Save Changes
						</Button>
						<Button
							onClick={() => this.handleChangePassword(this.state.user.email)}
						>
							Change Password
						</Button>
					</Stack>
					{/*<div> <Button variant="contained" component="label" sx={{ m: 1, backgroundColor: 'primary' }} > Upload Resume <input type="file" hidden accept=".doc, .docx, .pdf" /> </Button> </div>*/}
				</Box>
			);
		} else {
			return <Typography variant='h1'>Loading...</Typography>;
		}
	}
}

export default function (props) {
	const navigate = useNavigate();
	return <Profile {...props} navigate={navigate} />;
}

export { universityOptions };
